script: |
  super -f text -I q3596.spq | sort > q3596.out

inputs:
  - name: q3596.spq
    data: |
      SELECT DISTINCT + col2 + + 63 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE col2 NOT BETWEEN NULL AND + + ( - + 38 ) * - - col0 / - + 70;
  - name: tab1

outputs:
  - name: q3596.out
    data: |
      122
      131
      159
